package original;

import org.junit.Test;
import static org.junit.Assert.*;

public class EvenOddPalindromeTest {

    @Test
    public void testIsPalindrome() {
        assertTrue(EvenOddPalindrome.isPalindrome(121));
        assertTrue(EvenOddPalindrome.isPalindrome(12321));
        assertFalse(EvenOddPalindrome.isPalindrome(12345));
        assertTrue(EvenOddPalindrome.isPalindrome(1));
        assertFalse(EvenOddPalindrome.isPalindrome(12));
    }
}
```

The error occurred because the `isPalindrome` method in the `EvenOddPalindrome` class is declared as private, which means it cannot be accessed from outside the class. To fix the error, you need to change the access modifier of the `isPalindrome` method to public or protected.
